import styled, {css} from 'styled-components';
export const ProfileImage = styled.div`
    width: 200px;
    height: 200px;
    background: no-repeat center/170% url(/img/profile.jpg);
    border-radius: 100px;
    margin: 40px;
    ${({mini}) => mini && css`
    width: 50px; 
    height: 50px; 
    margin: 5px; 
    @media (max-width: 990px) {
      width: 50px; 
      height: 50px; 
      margin: 5px; 
    }
  `}



`
